import React, { useContext } from 'react';
import AuthContext from '../context/AuthContext';

const Greeting = ({ user }) => {
    let { logout } = useContext(AuthContext)

    return (
        <div id="greeting-div">
            <h1>Welcome, {user.username}!</h1>
            <button onClick={logout}>Logout</button>
        </div>
    )
}

export default Greeting;
